import React from "react"
import { Link } from "react-router-dom"
import { AppContext } from "./Context"


function Weather() {

    const { weatherArray } = React.useContext(AppContext)


    return (
        <>
            <h1>Weather</h1>
            {weatherArray}
            <Link to="/">Home</Link>
            <Link to="/tide">Tide</Link>

        </>
    )
}

export default Weather
